import DTLButton from './DTLButton'

export default function HomeBanner() {
  return (
   <>
   <div className="home__banner pt-40 pb-24">
    <div className="home-banner__head pb-[10px]">
        <h5 className="home-banner__head-text">White Label Development Agency</h5>
    </div>
   < DTLButton btnText={"Get Started"} />
   </div>
   </>
  )
}
